import "./App.css";
import { URL_GOOGLE_SHEETS } from "./constants";
import RolezandoList from "./pages/RolezandoList/RolezandoList";

function App() {
  const getData = () => {
    const data = fetch(URL_GOOGLE_SHEETS)
      .then((res) => res.text())
      .then((text) => JSON.parse(text.substr(47).slice(0, -2)));

    return data;
  };

  const data = getData("");

  console.log(data.then((result) => result));

  return (
    <div className="App">
      <RolezandoList list={data} />
    </div>
  );
}

export default App;
